INSERT INTO zj_about VALUES('1','关于我们','关于我们','关于我们','<p>\r\n	<h4 class=\"info-description margin-top-20\" style=\"font-family:Helvetica, Arial, \"font-weight:500;color:#727171;font-size:18px;background-color:#CCE8CF;\">\r\n		中国领先的社区增值服务提供商和资源整合者\r\n	</h4>\r\n</p>','1499146677','','1','1');
INSERT INTO zj_about VALUES('2','免责申明','免责申明','免责申明','<p>\r\n	<p style=\"color:#020014;font-size:16px;font-family:微软雅黑;\">\r\n		第一条、访问者在从事与本网站相关的所有行为(包括但不限于访问浏览、利用、转载、宣传介绍)时，必须以善意且谨慎的态度行事；访问者不得故意或者过失的损害本网站的各类合法权益，不得利用本网站以任何方式直接或者间接的从事违反中华人民共和国法律、国际公约以及社会公德的行为。\r\n	</p>\r\n	<p style=\"color:#020014;font-size:16px;font-family:微软雅黑;\">\r\n		第二条、我们对所有用户上传的资源、信息等，进行初步的审核，此审核主要限于是否违反国家法律、法规、社会公德但不包括资源侵权、信息真实与否等的深度审核。\r\n	</p>\r\n	<p style=\"color:#020014;font-size:16px;font-family:微软雅黑;\">\r\n		第三条、本网站在有理由确认有任何明显违反国家法律法规、侵犯任何第三人版权的作品存在时，有权不事先通知删除侵权作品。\r\n	</p>\r\n	<p style=\"color:#020014;font-size:16px;font-family:微软雅黑;\">\r\n		<br />\r\n	</p>\r\n</p>','1499146677','','2','1');
