INSERT INTO zj_help VALUES('1','如何注册成为本站会员','1','如何注册成为本站会员','如何注册成为本站会员','<p><br />\r\n点击网站顶部的注册链接进入填写注册信息页面，填写用户名、密码和邮件,点击注册按钮。</p>\r\n<p>注意： 1. 用户名注册以后是不能更改的&nbsp; 2. 注册用的邮箱是用于密码找回的，所以请尽量填写真实邮箱。</p>','1','1283498679','1');
INSERT INTO zj_help VALUES('2','如何登录网站','1','如何登录网站','如何登录网站','<p><br />\r\n点击头部的 [登陆] 链接进入登录页面后,填写用户名和密码进行登录。</p>','2','1283499260','0');
INSERT INTO zj_help VALUES('3','如何修改密码','1','如何修改密码','如何修改密码','<p>您可以在个人管理中心中点击【修改密码】的链接进入修改密码页面进行修改。</p>','3','1283499376','0');
INSERT INTO zj_help VALUES('4','如何找回密码','1','如何找回密码','如何找回密码','<p><br />\r\n如果您忘记了密码可以使用找回密码操作<br />\r\n<br />\r\n找回密码步骤：<br />\r\n第一步：点击找回密码链接进入填写用户名和邮箱页面。<br />\r\n第二步：填写您注册时输入的用户名和邮箱地址，发送重置密码邮件。<br />\r\n第三步：到邮箱中收信，点击邮件中的&ldquo;重置密码&rdquo;链接，进入重置密码页面<br />\r\n第四步：重新设置您的密码，完成找回密码操作。然后您就可以使用新密码登录了。</p>','4','1283499417','0');
INSERT INTO zj_help VALUES('5','如何修改个人资料','1','如何修改个人资料','如何修改个人资料','<p><br />\r\n您可以在个人管理中心中点击&ldquo;修改资料&rdquo;链接进入修改资料页面进行修改。</p>','5','1283499492','1');
INSERT INTO zj_help VALUES('6','什么是匿名发布','2','什么是匿名发布','什么是匿名发布','<p>匿名发帖就是不需要登录注册，直接发帖。</p>\r\n<p>匿名发布的信息，唯一的修改凭证就是发布信息时所填写的密码，请牢记这个密码。</p>','6','1283499666','0');
INSERT INTO zj_help VALUES('7','如何修改信息内容','2','如何修改信息内容','如何修改信息内容','<p>1.凭密码修改<br />\r\n发布信息的时候会让用户输入一个信息管理密码，您可以在信息详情页输入这个密码进行修改<br />\r\n2.登陆会员中心修改<br />\r\n如果信息是您在登陆状态下发布的，那么您可以登陆会员中心，点击【我的信息】列表，找到具体的信息进行修改，<br />\r\n也可以到信息详情页，点【编辑】进行修改。</p>','7','1283499832','0');
INSERT INTO zj_help VALUES('8','什么是一键更新信息','2','什么是一键更新信息','什么是一键更新信息','<p>一键更新信息可以使您的信息自然排在信息的最前端<br />\r\n点击信息详情页的【提升按钮】进行提升，一键更新信息消耗信息币，详情请看<a href=\'member.php?act=credit_rule\'>member.php?act=credit_rule</a></p>','8','1283500716','1');
INSERT INTO zj_help VALUES('9','如何置顶信息','2','如何置顶信息','如何置顶信息','<p>发布信息的时候可以选择信息置顶，也可以进入会员中心的信息管理，点击信息右侧的&ldquo;置顶&rdquo;链接进行置顶，信息置顶消耗信息币。</p>','9','1283500968','1');
INSERT INTO zj_help VALUES('10','什么是积分，有何用处','3','什么是积分，有何用处','什么是积分，有何用处','<p>积分是对用户注册、登陆、发布信息、发表评论的一种奖励，可以用积分兑换信息币，不用花钱置顶和刷新信息。</p>','10','1283501184','1');
INSERT INTO zj_help VALUES('11','什么是信息币','3','什么是信息币','什么是信息币','<p>信息币是本站一种虚拟货币，可以用来对信息进行刷新，置顶。</p>\r\n<p>有两种方式获得信息币，一是用钱购买信息币，二是用积分兑换信息币。查看付费的信息。</p>','11','1283501243','0');
