INSERT INTO zj_info VALUES('11243','3373','81','144','本人男，未婚，真诚寻觅另一半','本人未婚，真诚寻觅另一半。内心独白：再过半年，就30岁了，木有女友…我烟酒不沾，也不赌博，电脑，手机游戏，赌博，从来都不玩。自律性很强的，喜欢看书。很小的时候，我爸就因胃病去世，他走时，家里欠下不少钱。我妈坚强的守着一贫如洗的家，呵护着我，她多年前一直催我早点结婚，面对着那半个世纪前的老房子，我一直希望自己强大起来，有份好的事业。我心里一直在想，不希望在最困难的时候，让另一半来共担。如今，新房子在多年前已盖好，最困难的时期已经过去，在外也有份月薪七千元的收入。真恨岁月那把“杀猪刀”，转眼就已经而立之年了。我没有身边那些人大男子主义，对家，永远是“我奉献，我快乐”，“对老婆就应该是疼爱的”。“选择了就一辈子，矢志不渝”分享一个小故事。曾经在上海上班时，站在窗户边上，看到公交车上下来一对白发苍苍的老人，两人牵手沿着马路走，我是含着泪花的看着他们消失在马路的尽头。对，爱，就是永恒，直到永远。我虽人生经历很多挫折，可初次看到汶川大地震的航拍，泪如泉涌…我是个心地善良的人，曾发动同学们会生病的同学捐款，也为族亲弄过网上募捐…如果有缘走在一起，我一定会用生命来疼爱，呵护你。有意向的单身的女性，请加微信号13247053559\r\n','','','本人未婚，真诚寻觅另一半。内心独白：再过半年，就30岁了，木有女友…我烟酒不沾，也不赌博，电脑，手机游戏，赌博，从来都不玩。自律性很强的，喜欢看书。很小的时候，我爸就因胃病去世，他走时，家里欠下不少钱','','','','13247053559','','','','中国移动','1499146677','0','39.158.202.59','19','0','0','0','1');
