INSERT INTO zj_info VALUES('11131','2998','11','158','喷漆房循环水处理药剂除漆剂AB剂','喷漆房循环水处理药剂除漆剂AB剂\r\n\r\n   在涂装喷漆房喷漆过程中，一般通过水帘(水幕)装置的循环水吸收过喷漆雾，由于落漆越积越多，造成循环水浑浊、变质、发臭，影响生产的正常进行，故喷漆房的循环水一定周期就要排放更换。通过投加上海普懿除漆剂AB剂产品，使涂装喷漆循环水保持清澈无需排放，可以达到长期循环使用的标准。\r\n\r\n  除漆剂厂家会针对各类型油漆废水研发出系列除漆剂AB剂产品，包括针对(UV漆、PU漆、PE漆、NC漆)的废水的处理，除漆剂产品为绿色环保型，不含危化品元素，在涂装喷漆污水处理上真正可以做到环保处理的标准，在汽车喷漆、金属喷漆、家电家具、塑料喷漆等涂装喷漆行业中除漆剂AB剂已经成为喷漆房循环水处理必不可少的药剂。\r\n\r\n   1、除漆剂A剂：是一种分解及去除各类漆黏性之特殊处理药剂，其主成份为一种独特的无机高分子，尤其适合于喷漆台循环水系统中添加，以分解去除残漆，并有效控制循环水的生物活性、维护水质。\r\n\r\n   2、除漆剂B剂：是一种特殊的高分子聚合物，被应用于喷漆台循环水系统中，使被去除粘性的油漆颗粒被悬浮分离。它是一种独特的物质，可以有效防止油漆颗粒在喷漆台的循环水系统内累积。\r\n\r\n除漆剂AB剂产品性能：\r\n\r\n   1、延长设备使用寿命，大幅度降低污水处理费用及用水成本。\r\n   2、绿色环保，增进循环水可利用性。\r\n   3、除漆剂A剂保持水池水质清洁，改善喷房工作环境，提升工作效益，达到环保处理要求。\r\n   4、提高产量及效益，减少固体、气体废弃物排放。\r\n   5、任何性质的油漆污水只要在中性或碱性条件下PH值7.0-9.5之间，都可以具有极佳的凝聚性和上浮性。\r\n   6、完全不受油漆污水浓度的高低影响，AB剂都可以保持在一个稳定的状态。\r\n   7、漆渣不粘不臭，容易脱水。使水呈半透明至透明状，降低水中COD含量。\r\n\r\n除漆剂AB剂操作方式：\r\n\r\n　　1、建议未使用除漆剂之前先调整好水质的PH值，保持水质在PH在7-9左右;\r\n\r\n　　2、首先，除漆剂A剂添加在喷房循环水流最急处(即喷房抽水马达处);加好药后请照常生产和喷漆，在下班前30分钟加除漆剂B剂在平时打捞漆渣处(即聚漆槽);打捞悬浮漆渣即可;\r\n\r\n　　3、除漆剂A剂和B剂加药比例为1：1;(实际用量需根据现场情况) ;\r\n\r\n除漆剂AB剂处理与贮藏：\r\n1.免药液溅到眼睛，若接触药液，立即以大量清水冲洗接触部位。\r\n2.本产品储存于阴凉处，避免阳光直射。\r\n3.避免使用空桶盛装饮用水，不可存于铝、铁、铜之合金内。','','','喷漆房循环水处理药剂除漆剂AB剂\r\n\r\n   在涂装喷漆房喷','','','','15970997025','上海 - 宝山 - 罗泾 - 宝山区川北路','','','中国移动','1499146677','0','39.158.197.102','3','0','0','1','1');
