INSERT INTO zj_info VALUES('11189','3373','13','144','捷扬智能英语','捷扬智能英语是通过全国统一的经营管理模式，统一的教学产品，统一的课程体系，标准化的教学方法，是4-14岁少儿英语的英语学习平台。通过捷扬智能英语的学习，孩子能够真正打通英语听说读写关，熟练掌握英语的使用规律和规则，使英语学习渗透进孩子的潜意识，成为孩子丢不了、忘不掉、得心应手的语言技能。\r\n   加入捷扬世纪教育8大核心优势：\r\n    产品优势-投资优势-成本优势-市场优势-管理优势-营销优势-培训优势-让您获得更快更稳定的投资回报\r\n加入捷扬世纪教育2大震撼：\r\n领先世界的教学方法，让孩子说英语“张口就来”独特的课程体系确保加盟商全天候高效收益\r\n\r\n课程体系\r\n“智能拼读”课程：熟练运用智能拼读，不用借助国际音标或任何英语之外的注音系统，通过英语字母直接拼读出标准的英文发音。就像学习汉语拼音一样简单，学英语再也不愁单词记不住了，成绩自然有所提高，从此远离死记硬背。\r\n“词义速解”课程：在直读、直拼英语单词的基础上，快速认识并记忆英文单词的基本词义，解决困扰孩子们的英语词汇的音、形、义三大问题。这样，学习者的词汇量可以得到快速积累，英语语感也可以得到极大的提升。而充足的词汇储备和良好的语感是所有英语学习者拿下连贯表达必不可少的前提与基础。\r\n    “句法应用”课程：完成智能英语的全套课程学习后，可以完成句子表达能力，达到整篇写作，提高自由对话能力，使用英语进行流畅的口语交流。\r\n“学科同步”课程：按学生不同的学习阶段、学科特点和辅导需求，为学生定制个性的辅导内容。包括校内各科目个性化1对1同步辅导，面向基础知识薄弱的考生提供的个性化委托辅导，串讲与模考，暑假的预科课程辅导，优等生单科，全科辅导。\r\n','','','捷扬智能英语是通过全国统一的经营管理模式，统一的教学产品，统','','','','15970028958','','','','中国移动','1499146677','0','39.158.204.201','14','0','0','1','1');
