INSERT INTO zj_info VALUES('11490','7559','125','145','重金求购萨摩耶','梳毛要注意顺序：由颈部开始，由前向后，自上而下顺次进行，即先从颈部到肩部，然后依次背、胸、腰、腹、后躯，再梳头部，最后是四肢和尾部，梳理过程中应梳完一侧再梳另一侧。\r\n梳毛的手法:梳毛应按顺毛方向快速梳拉。许多人在给长毛犬梳毛时，只梳表面的长毛而忽略了下面的细茸毛梳理。犬的底毛，细软而绵密，长期不梳理，会形成缠结，甚至会引起湿疹、皮癣或其他皮肤病。因此在对长毛犬梳理时，应一层一层地梳，还要把长毛翻起来，然后对其底毛进行梳理。\r\n梳子的种类:毛刷、弹性钢丝刷和长而疏的金属梳。毛刷只能使长毛的末端蓬松，而细茸毛却梳不到。梳理长毛犬时，毛刷、弹性钢丝刷和长而疏的金属梳应配合使用','','','梳毛要注意顺序：由颈部开始，由前向后，自上而下顺次进行，即先从颈部到肩部，然后依次背、胸、腰、腹、后躯，再梳头部，最后是四肢和尾部，梳理过程中应梳完一侧再梳另一侧。\r\n梳毛的手法:梳毛应按顺毛方向快速','新一','','','13887675439','','','','本机地址','1500054046','0','127.0.0.1','32','0','1500540923','0','1');
