INSERT INTO zj_info VALUES('11393','6283','10','159','陶艺DIY――我想开的文艺青年范儿的店','“优加手作陶泥DIY”店内创意手工和实用性手工可以结合经营，既满足了大家的创意制作需求，也满足了实用性小物件自己制作的愿望。比如蜡烛DIY产品的创意性很强，也就是说可以选择自己喜欢的颜色造型香味自己制作，强调的是创意和好玩的过程。\r\n“优加手作陶泥DIY”店，用心打造自己的时尚DIY。优加手作陶泥DIY店为成都优加生活品牌营销策划有限公司旗下重点打造品牌，打造的是一个综合性的创意DIY手工店，可实现顾客亲手制作，创意打造。更多的创意选择，不断的创意更新，迎合每一个顾客的口味和需求。\r\n      泥巴，你还要怎么玩！在优加手作陶艺DIY店你可以这么玩：玩出了自己的风格和理想，玩出自己的时尚。优加手作陶艺DIY店推出陶艺DIY、瓷泥DIY、彩色瓷泥DIY、软陶定制、素坯彩绘及陶瓷彩绘等特色产品的DIY项目 。优加手作陶艺DIY店中陶艺DIY的材料很简单，但加上不同的工艺和创造力，作品便有了生命，栩栩如生起来。生活累了，倦了，去做一回陶泥匠吧。陶艺DIY――我想开的文艺青年范儿的店。一直想开一个什么店，终于找到一个我喜欢的，就是陶艺DIY拉！ \r\n\r\n\r\n    DIY的意思就是顾客自己动手制作的意思，自己制作两个方面比较不错，一是比较有特色，二是休闲娱乐性也比较强！我想融入手工DIY这个全新的模式，闺蜜朋友同学可以一起喝水，聊天，做手工！\r\n\r\n    玩逸生活陶艺DIY特别推出陶艺DIY、瓷泥DIY、彩色瓷泥DIY、软陶定制、素坯彩绘及陶瓷彩绘等特色产品的DIY项目，专业陶艺师现场教授指导，同时开办各种陶艺培训班，并不定期邀请知名陶艺家前来举办各种活动。所以想要做陶艺DIY店的一定要选玩逸生活哦，已经专属打造手工DIY事业12年了，您值得拥有！','','','“优加手作陶泥DIY”店内创意手工和实用性手工可以结合经营，','','','','18079729555','','','','中国移动','1499146677','0','39.158.202.120','18','0','0','1','1');
