INSERT INTO zj_info VALUES('11406','6283','9','146','主流时尚风格KM男装货架 名创优品货架 伶俐货架','过去的2016年，中国服装业增长指数成负数。2016年1-11月中国服装、鞋帽零售价格指数环比增长值-0.56。\r\n\r\n显然，全国整体快消品指数和社会零售总额呈逐年增长态势，而对于传统服装服饰领域来说，出现这样的局面，快时尚带来的冲击要远远被业界高估于奢侈服饰行业、电商崛起、经济下行、传统经济和传统商业经济转型带来的冲击。\r\n但是对于快时尚服装业本身，也在遭遇寒流冷逼。\r\n\r\n虽然不至于哀鸿遍野，但是快时尚产业整体日子难过。进入2016年，那些所谓的快时尚服装国际大牌也表现出度日唯艰的面色，令服装市场侧目的无疑是优衣库、H&M、GAP等众多国际快时尚品牌的集体“跳水”。\r\n\r\n实际上，快时尚服装行业市场仍有潜在需求与市场机会，但是由于快时尚自身发展的缺陷，导致快时尚在 “温室”疯长的状态中生病。传统零售模式的改变给快时尚带了机遇，但主流消费群体的改变和消费文化的转型，却不断使快时尚服装遭遇冷热无常的洗礼，本土快时尚自身强体健身功课做的本就不足，免疫机制尚未形成，所以遭遇滑落、甚至遭遇年轻消费者的抛弃都有可能。','','','过去的2016年，中国服装业增长指数成负数。2016年1-1','','','','1518802407微信','','','','中国移动','1499146677','0','117.165.32.161','11','0','0','1','1');
