INSERT INTO zj_info VALUES('11433','0','10','154','开一家有个性的礼品店,万元创业,年利润80万元','咱们优定制项目汇聚了国内外所有个性、时尚、创意的产品，打造国内较专业的创意时尚礼品馆。\r\n\r\n项目优势：\r\n1、免加盟费\r\n2、赠送市值1万元货品\r\n3、赠送全套定制设备\r\n4、产品价位几元、十几元\r\n5、利润空间较低5-10倍\r\n6、10平米即可开店\r\n7、一人即可操作\r\n8、技术培训免费更新\r\n9、每月盈利2-5万元以上\r\n10、3个月回收成本\r\n11、公司帮助选址\r\n12、公司设计装修\r\n13、公司带店指导\r\n14、公司帮助宣传\r\n平面定制是可以根据顾客的需求，将他们想要的图案、logo、照片，定制到咱们所有的产品上，比如个性的杯子、创意的抱枕、手机壳定制、木版画、瓷板画等等，15个系列，300多款定制类产品都可以个性定制。\r\n创意礼品部分，是不需要定制，可以直接售买的，它是融合了上千款个性、时尚的产品，每一款产品都有独特的功能和创意，有会飞的闹钟、会跑的闹钟、VR眼镜、抱枕遥控器等等。\r\n秦皇岛仕鼎商贸有限公司立足创意礼品，定制礼品的研发以及店面的经销，通过自主研发定制礼品以及整合国内创意礼品优质的厂家资源，2016年公司凭借出众的产品创意能力、雄厚的技术实力、专业的眼务团队、资深的店面运营经验、强大的资源背，先进的行业理念以及勤奋、创新的企业精神，正式开启全国加盟连锁，优定制项目是秦皇岛仕鼎旗下品牌之一，2016年 进军品牌连锁市场，秉承“让生活因定制更多彩”的理念，致力于打造全球最大的创意礼品定制连锁品牌在创意礼品定制行业一直处于第一品牌的优势地位，并保持全国连锁店销售额增长率连续数年高达500%产品线囊括了创意礼品，时尚饰品、珠宝手表、鞋包配饰、毛绒玩具，杯子餐具、家居 饰品、时尚文具、印刷品、水晶制品、T恤、照片冲印等数几十个大类超千款单品，线上线下销售 利润高达10倍.优定制的产品是通过专业的技术和专用的设备，在产品上印制自己的设计，比如照片、动漫人物，风景，明星等等所有想要的图像，创造独一无二的专属礼品.','','诚招酒庄店长，服务员,','咱们优定制项目汇聚了国内外所有个性、时尚、创意的产品，打造国','易','','','18707970003','','','','','1499146677','0','106.4.15.1','9','0','0','1','1');
INSERT INTO zj_info VALUES('11411','6283','9','156','贝洛安一线品牌正品尾货高档女装批发一手货源','贝洛安秋冬装2017年聚惠来袭 多批多优惠\r\n     \r\n品牌诠释\r\n时尚、典雅是BELLO ANN自创建以来一直寻求的风格，细腻的质感和流畅的线条无不彰显出舒适、洒脱、文艺、自由的特性。精致的裁剪透现出女性的柔美和个性气质。摒弃束身乏味的同时也颠覆了传统服饰的沉闷，品牌秉承设计是展示自我和情绪宣泄的一种方式，是对美追求的极致阐释，品牌不仅仅是时装，它代表的是一种生活状态，一种文艺与优雅的象征，将女性独有的柔美、性感与独特个性演绎至极。\r\n品牌文化\r\n企业精神: 激情、创新、协作、速度。\r\n人才 观: 有德有才重用；有德无才培养用；无德有才慎用；无德无才坚决不用！\r\n行为准则: 没有做不到，只有想不到！\r\n品牌风格:简约时尚 自在舒适 精致典雅 回归自然\r\n品牌定位:设计简洁 线条流畅 适合工作休闲 等各种场合穿着\r\n年龄定位：25―40岁BELLO AN的女人,她们恬淡不事张扬，却又不乏对时尚的敏锐嗅觉；她们优雅、知性，追求质感生活决不随 波逐流。她们欣赏艺 术，更向往艺术化的生活方式；她们永远知道自己需要什么，清楚自己的选择。\r\n价格定位：春夏369-1999元，秋冬599-3699元\r\n品　　牌 贝洛安\r\n分份方式 150件一份\r\n吊牌价位 798元―1298元\r\n批发价格 来电咨询\r\n货品结构 棉衣大衣：1%连衣裙：11%上衣衬衣：23%半裙：7%\r\n裤子：14%背心马夹：3%针织衫、毛衫：33%外套风衣：5%\r\n羽绒服：3%\r\n一手货源 分份批发\r\n一手货源：武汉爱弗瑞服饰有限公司整仓吃进品牌服饰厂家富余尾单产品，是国内最大的一手货源供应商之一。货品类别款式多，尺码齐全，吊牌、水洗唛齐全（少量剪标），单款数量少，适合零售店、商场折扣或区域性批发商。 \r\n分份批发：爱弗瑞服饰分份批发原则：均按原厂家富余尾单货品结构（产品类别及码号结构）均分打包成份，并按份出货；一份的数量是根据厂家提供的产品结构、数量而定；一般一份货品的数量在：200件至1000件之间','','','贝洛安秋冬装2017年聚惠来袭 多批多优惠\r\n     \r\n','','6866378@qq.com','','15079791250','','','','中国移动','1499146677','0','39.158.206.172','11','0','0','1','1');
INSERT INTO zj_info VALUES('11412','6283','8','160','喝出健康饮品','上海是一座神奇的城市被大家称为魔都，上世纪的三十年代，是上海话最黄金的时期，大量国外的新鲜事物，从上海开始进入中国，上海话贡献了无数的新词汇，嗲、阿三、差头、席梦思…\r\n\r\n这些词都是来自英语版的上海话，其中不少后来又被吸收进入了普通话之中。\r\n嗲这个词汇都是从沪语而来的。\r\n\r\n嗲：来自英文Dear，意为亲爱的，可爱的，引申为娇柔的，撒娇的，媚态万千的。用法如“发嗲”，即发出dear的音。\r\n\r\n取亲爱的，可爱的为意+上茶的文化=就有了今天的嗲茶品牌。\r\n\r\n嗲茶是：水果、茶、花、奶油；健康素材组合调制而成的。\r\n\r\n这是一杯有爱意的茶。\r\n','','','上海是一座神奇的城市被大家称为魔都，上世纪的三十年代，是上海','','','','13479735685易女','','','','中国移动','1499146677','0','39.158.206.172','17','0','0','1','1');
INSERT INTO zj_info VALUES('11414','6283','8','144','积膳佳餐饮积膳佳项目创业节火爆招商','积膳佳自成立以来，凭借自己专业的技术，独到的经营理念，不断的开发。\r\n越来越多人的生活习惯开始多元化，而西式快餐也是越来越多人所喜欢的一种饮食方式，炸鸡美食便是其中的佼佼者。\r\n很多炸鸡品牌在我国餐饮市场上先后出现，比如肯德基、麦当劳等。然而，这些大品牌造价非常昂贵！\r\n积膳佳餐饮在结合传统餐饮的工艺上，成就了一套成熟系统的秘制餐饮配方。这突破了传统餐饮制作技术不好复制，口味难把握、操作不规范、量化不准确的缺点，把制作流程工艺化、数字化！真正让有志于发掘舌尖上财富的零经验者速成。\r\n 除此之外，小餐饮亦能成就大企业，您可以发现，积膳佳餐饮就在我们的身边！\r\n积膳佳餐饮旗下项目有中餐、快餐、韩餐、早点、主题餐厅等众多餐饮项目，在全国合作伙伴生意也是异常的火爆。\r\n无论你想学技术还是想做餐饮加盟，济南积善佳餐饮必定会有您需要的，你可以没有餐饮经验也不必进行商业加盟，自己创业当老板开自己的特色小店，自己赚钱更轻松。\r\n','','','积膳佳自成立以来，凭借自己专业的技术，独到的经营理念，不断的','','','','15970904574孙生','','','','中国移动','1499146677','0','39.158.206.172','13','0','0','1','1');
