INSERT INTO zj_info VALUES('11428','6283','9','147','2017中国十大保暖内衣品牌工厂直招全国经销商','江阴吉泰轻纺有限公司前身为国内最早集体企业之一的无锡市第八针织厂，董事长杨文洁从事针织行业30多年，对针织类产品的研发，生产及销售具有非常丰富的经验，几十年来，奠定了在行业内的领先优势：\r\n&#61552;兼具丰富的外贸和内销生产经验，一直为优衣库、圣大保罗等国际知名品牌以及波司登、帕兰朵、雪中飞等国内领先的服饰内衣品牌代工。\r\n&#61552;涉及的针织产品齐全，目前国内主营的产品包括保暖内衣、秋衣秋裤、内裤、袜子、家居服等。\r\n&#61552;产品设计丰富多彩，作为内衣行业的领军企业，在保暖内衣领域一直是申领国家专利最多的企业（国家专利网可搜董事长姓名：杨文洁）。\r\n&#61552;企业工厂出货体量大，响应速度快，生产和补货周期灵活可控。\r\n&#61552;传统线下销售维护良好并及时向电子商务转型，目前电商各大平台热销款式大部分都来自我们企业的设计和生产。 \r\n&#61552;作为帕兰朵、波司登内衣10多年之久的供应商，我们的合作非常成熟，合作关系稳定，各种产品线非常丰富，可以满足一般各类内衣品牌和店铺的所有款式。\r\n我们的合作模式：\r\n我们欢迎线上线下的全国各类经销加盟体系合作洽谈，包括线下各类实体门店、各大中小型商超、区域代理、商场专柜以及线上各类电商平台店铺均可。我们可以提供包括帕兰朵、波司登内衣等品牌内衣的批发还可为自有品牌代工生产，保证厂家一手货源和供价，免去各类环节。\r\n我们的要求：\r\n    对于各类经销加盟机构，我们有如下要求：\r\n1.正规合法的相关营业证件。\r\n2.一定的资金周转实力。\r\n3.丰富的行业经营能力。','','','江阴吉泰轻纺有限公司前身为国内最早集体企业之一的无锡市第八针','','','','15279707966','上海 - 嘉定 - 南翔 - 佳通路31弄3号楼907','','','中国移动','1499146677','0','39.158.198.133','8','0','0','1','1');
